import React from 'react'
import { Link } from 'react-router-dom'
import { Logo } from '../../shared/images'

const Navbar = () => {
  return (
    <nav className='navbar'>
      <Link>
        <img
          src={Logo}
          className='flex-none w-10'
        />
      </Link>
    </nav>
  )
}

export default Navbar
